function createTrigger(content){
	if (!isLoggedIn()){
		return -1;
	}
 var match=content.match("\ *CREATE\ +TRYGGER\ +([^\ ]+)");
 var trigger;
 if(match){  
  trigger=document.createElement("li"); 
  trigger.style.color="#16387C";
  trigger.style.fontSize="12px";
  trigger.style.padding="3px 0 2.5px 8px";   
  var triggerIn=document.createElement("span"); 
  triggerIn.title=content;
  triggerIn.appendChild(document.createTextNode(match[1]));
  var enableicon=document.createElement("div"); 
  enableicon.style.visibility="hidden";
  enableicon.style.backgroundImage=on;
  enableicon.className="on";
  enableicon.style.cssFloat="right";
  enableicon.style.height="12px";  
  enableicon.style.width="12px";    
  var logicon=document.createElement("div"); 
  logicon.style.visibility="hidden";
  logicon.style.backgroundImage=log;
  logicon.className="log";
  logicon.style.cssFloat="right";
  logicon.style.height="12px";  
  logicon.style.width="12px";    
  var deleteicon=document.createElement("div"); 
  deleteicon.className="deleteicon";
  deleteicon.style.visibility="hidden";  
  trigger.addEventListener("mouseover",function(ev){
                                                   enableicon.style.cursor="pointer";  
                                                   logicon.style.cursor="pointer";  
                                                   deleteicon.style.cursor="pointer";  
                                                   triggerIn.style.cursor="pointer";
                                                   triggerIn.style.textDecoration="underline";                                                   
                                                   enableicon.style.visibility="visible";
                                                   logicon.style.visibility="visible";
                                                   deleteicon.style.visibility="visible";
                                                   },true);
  trigger.addEventListener("mouseout",function(ev){
                                                   enableicon.style.cursor="";  
                                                   logicon.style.cursor="";  
                                                   deleteicon.style.cursor="";    
                                                   triggerIn.style.cursor="";
                                                   triggerIn.style.textDecoration="";
                                                   enableicon.style.visibility="hidden";    
                                                   logicon.style.visibility="hidden";    
                                                   deleteicon.style.visibility="hidden";
                                                   },true); 
  trigger.addEventListener("click",function(ev){document.getElementById("qid").value=triggerIn.title;},true);                                                   
  enableicon.addEventListener("click",function(){
                                                   if(enableicon.className=="on"){
                                                    enableicon.className="off";
                                                    enableicon.style.backgroundImage=off;
                                                    deactivateTrygger(triggerIn.title);
  						   }else{
                                                    enableicon.className="on";
                                                    enableicon.style.backgroundImage=on;  
                                                    activateTrygger(triggerIn.title);						   
  						   }
  
                                                   },true);    
  deleteicon.addEventListener("click",function(){deleteTrygger(triggerIn.title);
  												trigger.parentNode.removeChild(trigger);},true);                                                
  trigger.appendChild(triggerIn);
  trigger.appendChild(deleteicon);    
  trigger.appendChild(enableicon);   
  trigger.appendChild(logicon);   
 }
 else{
     alert ("Are you trying to create a Trygger? It must start  with CREATE TRYGGER...");
 }
 return trigger;
}


function addToTriggers(){
	if (!isLoggedIn()){
		return -1;
	}
 var txt=document.getElementById("qid").value;
 var trigger=createTrigger(txt);
 if(trigger){
  var list=document.getElementById("tmyhead_content").getElementsByTagName("ul").item(0);
  list.appendChild(trigger);
   saveTrygger(txt);
 }
 return 0;
}

function loadTriggers(){
 var user = getUserName ();
 getFromServer ("load?user="+user);	
}

//////////////Call to the server
function activateTrygger(trygger){
	var q= queryfyText(trygger);
 return postToServer ("activate?trygger=", q);
}

function deactivateTrygger(trygger){
	var q= queryfyText(trygger);
 return postToServer ("deactivate?trygger=", q);
}

function saveTrygger(trygger){
	var q= queryfyText(trygger);
 return postToServer ("save?trygger=", q);
}

function deleteTrygger(trygger){
	var q= queryfyText(trygger);
 return postToServer ("delete?trygger=", q);
}

function postToServer(path, query){
	if (!isLoggedIn()){
		return -1;
	}
 GM_xmlhttpRequest({
  method: "POST",
  url: tryggerURL+path+escape(JSON.stringify(query)),
  onload: function(response) {
    var parser=new DOMParser();
    var xml=parser.parseFromString(response.responseText, "text/xml");
	
	var result=xml.getElementsByTagName("result");
	    var res=null;
	    if(result.length>0){
	     res=result[0].textContent;
		}else{
		 res="ok??";
		 }
    document.getElementById("formatviewcontent").innerHTML=res;
  }
 });
 return 0;
}

function getFromServer(path){
  GM_xmlhttpRequest({
  method: "GET",
  url: tryggerURL+path,
  onload: function(response) {
    var parser=new DOMParser();
    var xml=parser.parseFromString(response.responseText, "text/xml");
	var result=xml.getElementsByTagName("result");
	 for(i=0;i<result.length;i++){
		  var trigger=createTrigger(result[i].textContent); 
		  if(trigger){
			var list=document.getElementById("tmyhead_content").getElementsByTagName("ul").item(0);
			list.appendChild(trigger);
			}
		 }
  }
 });
 return 0;
}
